●弾力性に富み、ガラス面との密着性に優れる高級天然ゴムを採用し、精度の高いカッティングで高い払拭性を実現しました●ワイパー表面には高密度なグラファイトコーティングを施すことで、ガラスコーティング剤を施工したガラス面でも鳴き・ビビリのない静粛性を発揮します。<BR>●自動車用ワイパー替えゴム（標準タイプ）<BR>●全長(mm):500●全幅(mm):6●形状:角型(日産ニューツインレール)<BR>●材質:天然ゴム<BR><tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


